claims:
1.一种聚己二酸对苯二甲酸丁二酯/淀粉高阻隔复合膜，采用夹心结构，其特征在于：所述的聚己二酸对苯二甲酸丁二酯复合材料为外层，所述的夹心层为淀粉纳米复合材料层，所述夹心层厚度为整个复合膜厚度的40％-90％；1. a polybutylene adipate terephthalate/starch high barrier composite film, adopts sandwich structure, is characterized in that: described polybutylene adipate terephthalate composite material is outer layer, The sandwich layer is a starch nanocomposite material layer, and the thickness of the sandwich layer is 40%-90% of the thickness of the entire composite film;


         其中所述的淀粉纳米复合材料层的组成按重量份为：淀粉30-80份、增塑剂10-50份、润滑剂0.2-8份、增容剂0.5-5份、纳米材料3-30份、亲水性聚合物5-50份、多元有机酸0.5-15份、生物降解聚酯2-30份、聚酯多元醇0.5-20份；Wherein the composition of the starch nanocomposite material layer is as follows in parts by weight: 30-80 parts of starch, 10-50 parts of plasticizer, 0.2-8 parts of lubricant, 0.5-5 parts of compatibilizer, 3-30 parts of nanomaterial 5-50 parts of hydrophilic polymer, 0.5-15 parts of polybasic organic acid, 2-30 parts of biodegradable polyester, 0.5-20 parts of polyester polyol;


         所述的聚己二酸对苯二甲酸丁二酯复合材料层的组成按重量份为：聚己二酸对苯二甲酸丁二酯30-80份，增塑剂5-40份，其它生物降解聚酯5-40份，纳米填料3-30份，改性淀粉2-40份，其它加工助剂0.5-15份。The composition of the polybutylene adipate terephthalate composite material layer is in parts by weight: 30-80 parts of polybutylene adipate terephthalate, 5-40 parts of plasticizer, other biological 5-40 parts of degraded polyester, 3-30 parts of nano filler, 2-40 parts of modified starch, and 0.5-15 parts of other processing aids.

2.根据权利要求1所述的聚己二酸对苯二甲酸丁二酯/淀粉高阻隔复合膜，其特征在于：所述的淀粉纳米复合材料层中淀粉为天然淀粉或改性淀粉；2. polybutylene adipate terephthalate/starch high barrier composite film according to claim 1, is characterized in that: starch in the described starch nanocomposite material layer is natural starch or modified starch;


         所述的增塑剂是甘油、聚乙二醇、柠檬酸酯、三乙酸甘油酯、二乙酸甘油酯、单乙酸甘油酯中的一种或两种以上的混合物；The plasticizer is one or a mixture of two or more of glycerin, polyethylene glycol, citric acid ester, triacetin, diacetin and monoacetin;


         所述的增容剂是马来酸酐、硅烷偶联剂、钛酸酯偶联剂中的一种或两种以上的混合物；The compatibilizer is one or a mixture of two or more of maleic anhydride, silane coupling agent and titanate coupling agent;


         所述的润滑剂是硬脂酸及其盐类和单脂肪酸甘油酯；所述的纳米材料为天然的或有机改性的蒙脱土；The lubricant is stearic acid and its salts and monoglyceride; the nanomaterial is natural or organically modified montmorillonite;


         所述的亲水性聚合物是指羟丙基甲基纤维素、羧甲基纤维素、羟丙基纤维素、甲基纤维素、聚乙烯醇中的一种或两种以上的混合物；The hydrophilic polymer refers to one or a mixture of two or more of hydroxypropylmethylcellulose, carboxymethylcellulose, hydroxypropylcellulose, methylcellulose, and polyvinyl alcohol;


         所述的多元有机酸是指柠檬酸、乙二酸、丙二酸、丁二酸、戊二酸、己二酸、2-羟基丁二酸、2,3-二羟基丁二酸中的一种或两种以上的混合物；Described polyhydric organic acid refers to one of citric acid, oxalic acid, malonic acid, succinic acid, glutaric acid, adipic acid, 2-hydroxysuccinic acid, 2,3-dihydroxysuccinic acid a mixture of two or more;


         所述的生物降解聚酯是指聚乳酸、聚乙交酯、聚己内酯、聚羟基脂肪酸酯、聚己二酸对苯二甲酸丁二酯中的一种或两种以上的混合物；The biodegradable polyester refers to one or a mixture of two or more of polylactic acid, polyglycolide, polycaprolactone, polyhydroxyalkanoate, polybutylene adipate terephthalate;


         所述的聚酯多元醇是聚己内酯二元醇、聚己内酯三元醇、聚丙交酯二元醇、聚碳酸酯二元醇中的一种或两种以上的混合物。The polyester polyol is one or a mixture of two or more of polycaprolactone diols, polycaprolactone triols, polylactide diols, and polycarbonate diols.

3.根据权利要求1所述的聚己二酸对苯二甲酸丁二酯/淀粉高阻隔复合膜，其特征在于：所述的聚己二酸对苯二甲酸丁二酯复合材料层中的增塑剂为乙酰柠檬酸三丁酯、柠檬酸三丁酯、乙酰柠檬酸三乙酯、柠檬酸三乙酯、三醋酸甘油酯、二醋酸甘油酯、二乙酰环氧脂肪酸甘油酯、低聚乙交酯中的一种或两种以上的混合物；3. polybutylene adipate terephthalate/starch high barrier composite film according to claim 1, is characterized in that: in described polybutylene adipate terephthalate composite material layer The plasticizer is acetyl tributyl citrate, tributyl citrate, acetyl triethyl citrate, triethyl citrate, glyceryl triacetate, glyceryl diacetate, diacetyl epoxy fatty acid glyceride, oligomeric One or a mixture of two or more glycolides;


         所述的其它生物降解聚酯为聚乳酸、聚羟基脂肪酸酯、聚乙交酯、聚丁二酸丁二醇酯中的一种或两种以上的混合物；The other biodegradable polyester is one or a mixture of two or more of polylactic acid, polyhydroxyalkanoate, polyglycolide, polybutylene succinate;


         所述的改性淀粉为醋酸酯淀粉、羟丙基淀粉、甲氧基淀粉、辛烯基琥珀酸淀粉酯中的一种或两种以上的混合物；The modified starch is one or a mixture of two or more of acetate starch, hydroxypropyl starch, methoxy starch, and octenyl succinic acid starch ester;


         所述的纳米填料是指有机改性蒙脱土，超细碳酸钙，纳米二氧化硅、天然或改性的超细纤维素中一种或两种以上的混合物；The nano-filler refers to organically modified montmorillonite, superfine calcium carbonate, nano silicon dioxide, natural or modified superfine cellulose, or a mixture of two or more;


         所述的加工助剂为开口剂或稳定剂或粘合剂或其混合物。The processing aid is an antiblocking agent or a stabilizer or a binder or a mixture thereof.
